{
    displayName = "ymjxkodggqrhjnmusta",
    description = "cuviaxytqckkybxwc",
    tags = new
    {
        key30 = "nqrdpedyhkjzgrbtqhxbmkdmlpdf",
    },
    properties = new
    {
        key9192 = "e",
    },
    evaluators = new
    {
